import React, { useState, useEffect } from 'react';
import axios from 'axios';
import yaml from 'js-yaml';
import { Card, Button, Container } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
const App = () => {
  const [projects, setProjects] = useState([]);
  const [Tags, setTags] = useState({
    Stage: new Set(['Preprocessing', 'Dimensionality Reduction', 'Quantitative Evaluation', 'Visualization']),
    Tools: new Set(['Inaccurate', 'Suboptimal', 'Incomplete', 'Unstable', 'Uninterpretability', 'Unscalable', 'Irrefective', 'Uninformed']),
    Aim: new Set(['Enhance reliability', 'Enhance awareness', 'Enhance Approachability']),
    Solution: new Set(['Improvements on DR', 'Improvements of Evaluation', 'Visualization Stage Solutions', 'DR framework', 'Visual Analytics System', 'Literature Review', 'Human-Centered Experiment', 'Computational Experiment'])
  });
  const [selectedTags, setSelectedTags] = useState({
    Stage: new Set(),
    Tools: new Set(),
    Aim: new Set(),
    Solution: new Set()
  });
  const tagCategoryMap = {
    Stage: ['Preprocessing', 'Dimensionality Reduction', 'Quantitative Evaluation', 'Visualization'],
    Tools: ['Inaccurate', 'Suboptimal', 'Incomplete', 'Unstable', 'Uninterpretability', 'Unscalable', 'Irreflective', 'Uninformed'],
    Aim: ['Enhance reliability', 'Enhance awareness', 'Enhance Approachability'],
    Solution: ['Improvements on DR', 'Improvements of Evaluation', 'Visualization Stage Solutions', 'DR framework', 'Visual Analytics System', 'Literature Review', 'Human-Centered Experiment', 'Computational Experiment']
  };


  useEffect(() => {
    axios.get('/papers2.yml')
      .then(response => {
        const parsedProjects = yaml.load(response.data);
        setProjects(parsedProjects);

        // Log the entire projects array to see all data
        console.log("All projects loaded:", parsedProjects);

        // Optionally, log only the Tags of each project if projects are structured correctly
        parsedProjects.forEach((project, index) => {
          console.log(`Tags for project ${index}:`, project.Tags);
        });
      })
      .catch(error => console.error("Error loading or parsing YAML data:", error));
  }, []);


  const toggleTag = (category, tag) => {
    const newSet = new Set(selectedTags[category]);
    if (newSet.has(tag)) {
      newSet.delete(tag);
    } else {
      newSet.add(tag);
    }
    setSelectedTags({ ...selectedTags, [category]: newSet });
  };

  const filteredProjects = projects.filter(project => {
    console.log(`Evaluating project:`, project);
    return Object.keys(selectedTags).every(category => {
      const relevantTags = tagCategoryMap[category]; // Get relevant tags for this category
      const tagsInProject = relevantTags.some(tag => {
        const tagValue = project.Tags[tag]; // Access the tag directly from project.Tags
        const isTagValid = tagValue !== undefined && tagValue !== null && !isNaN(tagValue); // Check if tag value is valid
        console.log(`Checking tag: ${tag}, Value: ${tagValue}, Valid: ${isTagValid}`);
        return isTagValid;
      });

      console.log(`Category ${category} has tags in project: ${tagsInProject}`);
      return selectedTags[category].size === 0 || tagsInProject; // Check if no tags selected or if any relevant tag exists and is valid
    });
  });





  return (
    <Container fluid="md" className="app-container">
      <div style={{ display: 'flex', height: '100vh', marginRight: '20px' }}>
        <div style={{ width: '20%', position: 'sticky', top: 0, height: '100vh', overflowY: 'auto' }}>
          <h3>Filter Projects</h3>
          {Object.keys(Tags).map(category => (
            <div key={category}>
              <h5>{category}</h5>
              {Array.from(Tags[category]).map(tag => (
                <Button
                  key={tag}
                  onClick={() => toggleTag(category, tag)}
                  variant={selectedTags[category].has(tag) ? 'secondary' : 'outline-secondary'}
                  className="mb-2"
                  style={selectedTags[category].has(tag) ? {margin: "2px",backgroundColor: 'Grey', color: 'white', border: 'none', padding: '4px 7px', borderRadius: '5px', cursor: 'pointer', fontSize: '0.5rem' } : { margin: "2px",backgroundColor: '#f0f0f0', color: 'black', border: 'none', padding: '4px 7px', borderRadius: '5px', cursor: 'pointer', fontSize: '0.5rem' }}
                >
                  {tag}
                </Button>
              ))}
            </div>
          ))}
          {/* Reset Button */}
          <div className="Tags">
            <button
              id="reset-filter"
              onClick={() => setSelectedTags({ Stage: new Set(), Tools: new Set(), Aim: new Set(), Solution: new Set() })}
              style={{ backgroundColor: 'red', color: 'white', border: 'none', padding: '4px 7px', borderRadius: '5px', cursor: 'pointer', fontSize: '0.5rem' }}
            >
              Reset X
            </button>
          </div>
        </div>
        <div style={{ flex: '3', columnCount: 4, columnGap: '1rem',overflowY:"auto" }}>
          {filteredProjects.map((project, index) => (
            <div key={index} style={{ marginBottom: '1rem' }}>
              <Card>
                {project.image && (
                  <Card.Img variant="top" src={`/assets/images/project/${project.image}`} />
                )}
                <Card.Body>
                  <Card.Title>{project.Title}</Card.Title>
                  <Card.Text>
                    {project.Authors}<br />
                    {project.Venue} - {project.Year}
                  </Card.Text>
                </Card.Body>
              </Card>
            </div>
          ))}
        </div>
      </div>
    </Container>
  );
};

export default App;
